var LineChart = function LineChart() {
  return import('../charts/LineChart.vue');
};

import { getPatientCountAPI } from '@/api/homeAPI.js';
export default {
  name: '',
  data: function data() {
    return {
      loading: true,
      year: 2018,
      lineXAxisData: [],
      lineData: []
    };
  },
  components: {
    LineChart: LineChart
  },
  methods: {
    /**
     * 返回首页
     */
    backOverview: function backOverview() {
      this.$emit('back-overview', '');
    },

    /**
     * 获取患者折线图数据
     */
    getPatientCount: function getPatientCount() {
      var _this = this;

      this.loading = true;
      return getPatientCountAPI({
        year: this.year
      }).then(function (res) {
        var data = res.data.data;
        var lineXAxisData = [];
        var lineData = [];
        data.forEach(function (item) {
          lineXAxisData.push("".concat(item.month, "\u6708"));
          lineData.push(item.patientNum);
        });
        _this.lineXAxisData = lineXAxisData;
        _this.lineData = lineData;
        _this.loading = false;
      }).catch(function (err) {
        _this.loading = false;
      });
    }
  },
  created: function created() {
    this.getPatientCount();
  }
};
